### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Methods for Problem Solving**
   - **State Space Search**: Understanding state spaces, state space graphs, and the properties of states and moves.
   - **Search Algorithms**: Depth First Search (DFS), Breadth First Search (BFS), Best First Search, and Hill Climbing.
   - **Heuristics**: Manhattan distance, Nearest Neighbour Heuristic, Greedy Heuristic.
   - **Graph Representation**: Nodes, edges, and graph traversal techniques.

2. **Water Jug Puzzle**
   - **State Representation**: Representing states as tuples, e.g., (3, 0, 0).
   - **Moves**: Basic moves allowed in the puzzle, such as filling and emptying jugs.
   - **State Space Graph**: Constructing and analyzing the state space graph.

3. **Traveling Salesman Problem (TSP)**
   - **Tour Representations**: Path representations, adjacency representations, and ordinal representations.
   - **Heuristics and Algorithms**: Nearest Neighbour Heuristic, Greedy Heuristic, and Partially Mapped Crossover (PMX).
   - **Savings List**: Computing savings and constructing savings tours.

4. **Graph Theory**
   - **Nodes and Edges**: Understanding the structure and connections in a graph.
   - **Special Nodes**: Start and goal nodes, and their significance in search algorithms.
   - **Distance Matrix**: Using distance matrices to compute edge costs and construct tours.

#### Important Principles

1. **State Space Search**
   - **Reversibility of Moves**: Not all moves are reversible in a state space.
   - **Reachability**: Not all states are reachable from every other state.
   - **Goal State Reachability**: The goal state may or may not be reachable from the start state.

2. **Search Algorithms**
   - **DFS**: Explores as far as possible along each branch before backtracking.
   - **BFS**: Explores all neighbors at the present depth before moving on to nodes at the next depth level.
   - **Best First Search**: Uses a priority queue to explore the most promising nodes first.
   - **Hill Climbing**: Iteratively makes small changes to the current solution to improve it.

3. **Heuristics**
   - **Manhattan Distance**: A heuristic used to estimate the distance between two points in a grid.
   - **Nearest Neighbour Heuristic**: Selects the nearest unvisited city as the next stop.
   - **Greedy Heuristic**: Makes the locally optimal choice at each stage with the hope of finding a global optimum.

#### Important Equations

1. **Manhattan Distance**
   \[
   D = |x_1 - x_2| + |y_1 - y_2|
   \]
   where \((x_1, y_1)\) and \((x_2, y_2)\) are the coordinates of two points.

2. **Edge Costs**
   - Edge costs are computed based on the distance between nodes. For example, the cost of an edge between nodes A and D is given by the distance between them.

3. **Savings in TSP**
   - Savings are computed to determine the reduction in cost when combining two edges. For example, the savings \(s_{ij}\) for combining edges \(i\) and \(j\) is given by:
   \[
   s_{ij} = c_{i0} + c_{0j} - c_{ij}
   \]
   where \(c_{i0}\) and \(c_{0j}\) are the costs of edges from node \(i\) to the fulcrum node and from the fulcrum node to node \(j\), respectively, and \(c_{ij}\) is the cost of the edge directly connecting nodes \(i\) and \(j\).

